import { Link } from "react-router-dom"

const Customer = ({members}) => {
    const member = members.find((id) => id.id === id)
    return (
        <div>
            <h1>Detalhes da Empresa</h1>

            <p>
            Nome da empresa: {member && member.name}
            </p>

            <Link to="/">
            Voltar
            </Link>
        </div>
    )
}

export default Customer
